import React from 'react'
import { Link } from 'react-router-dom'
import Logo from './Logo'


const HeaderIconHome = () => {
    const handleLogout = () => {

        const action = {
          type: types.logout
        }
        dispatch(action)

        navigate('/login', {
          replace: true,
        })
      }
    return (
        <div className='headerIconHomeContainer'>
            <div className='iconHomeContainer'>
                <div className='containerHomeInicio'>
                    <i class="fas fa-home"></i>
                    <p><Link to = '/'>Inicio</Link></p>
                </div>
                <Logo /><div className='cotainerBtn'>
                 <button className='btnIngresar' onClick={handleLogout}>Salir</button>
                </div>
            </div>

        </div>
    )
}

export default HeaderIconHome
